// src/Header.js
import React from 'react';

const Header = () => {
    return (
    <header style={styles.header}>
        <h1>Calendar App</h1>
    </header>
    );
};

const styles = {
    header: {
    textAlign: 'center',
    padding: '10px',
    background: '#f5f5f5',
    borderBottom: '1px solid #ddd',
    },
};

export default Header;
